import styled from "styled-components";

export const LightText = styled.h1`
  font-size: 20px;
  color: #333333;
  padding-bottom: 20px;
`;

export const HeavyText = styled.h1`
  font-weight: bold;
  font-size: 42px;
  display: flex;
  align-items: center;
`;

export const Picture = styled.img`
  max-width: 35vw;
  height: auto;
  margin-left: 91px;
  margin-top: 90px;
  margin-right: 73px;
`;
